import React from 'react';
import { Link } from 'react-router-dom';

function UserDashboard() {
  return (
    <div>
      <h2>User Dashboard</h2>
      <div>
        <Link to="/sell">
          <button>Sell</button>
        </Link>
        <Link to="/buy">
          <button>Buy</button>
        </Link>
      </div>
    </div>
  );
}

export default UserDashboard;
